	public static org.json.simple.JSONObject getUserReviews(String url,
			String appId, String filePath) {
		Client client = Client.create();
		/*
		 * if (url.endsWith("/")) { url = url + "listApps"; } else { url = url +
		 * "listApps"; }
		 */
		JSONParser parser = new JSONParser();
		org.json.simple.JSONObject review = null;

		try {
			review = (org.json.simple.JSONObject) parser.parse(new FileReader(
					filePath));
			review = (org.json.simple.JSONObject) review.get(appId);
		} catch (FileNotFoundException e) {
			DigiLoggerUtils.log("Json File Not Found : " + filePath, LEVEL.error);
		} catch (IOException e) {
			DigiLoggerUtils.log("I/O Error : " + filePath, LEVEL.error);
		} catch (ParseException e) {
			e.printStackTrace();
			DigiLoggerUtils.log(
					"Invalid Json : " + filePath + " ::" + e.getMessage(),
					LEVEL.error);
		}

		client.destroy();
		return review;
	}

